import React from 'react';
import './Home.css';
import { Image,Button } from 'react-bootstrap';

const Home = () => {
  return (
    <div className="container-fluid p-0">
      <div className="row m-0">
        <div className="col-12 text-center position-relative vh-100">
          <h1 className="position-absolute w-100 text-light" style={{ top: '20px', zIndex: 2 }}>Welcome to MyApp</h1>
          <p className="position-absolute w-100 text-light" style={{ top: '80px', zIndex: 2 }}>
            This is the home page of your application. Feel free to explore the features available.
          </p>
          <Image
            src='https://images.pexels.com/photos/4406689/pexels-photo-4406689.jpeg?auto=compress&cs=tinysrgb&w=600'
            alt="Welcome Banner"
            className="img-fluid full-screen-img"
          />
          <Button c></Button>
        </div>
      </div>
    </div>
  );
};

export default Home;
